[Q]: You want to identify patients who can be diagnosed with Diabetes. To do so you are interested in patients who have a BMI value of 30 or greater that have received a glucose test where the value returned by the test was higher than 100 mg/dL result between 2018-02-01 and 2019-04-01.
[SPARQL]: PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX syn: <https://knacc.umbc.edu/dae-young/kim/ontologies/synthea#>
PREFIX snomed: <https://knacc.umbc.edu/dae-young/kim/ontologies/synthea#snomed:SNOMED-CT>
PREFIX loinc: <https://knacc.umbc.edu/dae-young/kim/ontologies/synthea#loinc:LOINC>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
SELECT DISTINCT ?patientId
WHERE {
  {  # Get patients with blood glucose level > 100 in the last 30 months
    ?obs a syn:Observation;
    syn:observationType loinc:2338-3; # Glucose
    syn:value gt "100"^^xsd:float;
    syn:patientId ?patientId;
    syn:issuedBetween "2018-02-01"^^xsd:date, "2019-04-01"^^xsd:date
  }
  UNION
  {  # OR Get patients with BMI level > 30
    ?obs a syn:Observation;
    syn:observationType loinc:39156-5; # BMI
    syn:value gt "30"^^xsd:float;
    syn:patientId ?patientId;
    syn:issuedBetween "2018-02-01"^^xsd:date, "2019-04-01"^^xsd:date
  }
}

