[Q]: Please give me information about 'Isoniazid' medication.
[SPARQL]: PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX syn: <https://knacc.umbc.edu/dae-young/kim/ontologies/synthea#>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
PREFIX ct: <https://knacc.umbc.edu/dae-young/kim/ontologies/synthea#umls:RxNorm>
SELECT ?ctId ?name ?form ?strength ?units
WHERE
{
  ?drug a syn:Drug;
  syn:drugType 'Medication';
  syn:rxNormId ?ctId;
  syn:name ?name;
  syn:form ?form;
  syn:strength ?strength;
  syn:units ?units.
{
    # Exact match: Use double quotes to indicate an exact match
    FILTER (?name = "Isoniazid")
}
UNION
{
    # Isoniazid(contains): Search for matches that contain the string "Isoniazid"
    FILTER (regex(str(?name), "Isoniazid", "i"))
}
}

